import { Link } from 'react-router-dom';
import '../css/Home.css';
// import heroImage from '../images/hero.jpg'; // Large Portrait
// import dsaImage from '../images/dsa.jpg'; // DSA section Image

function Home() {
  return (
    <div className="home-container">
      {/* Hero Section */}
      <div className="hero-section">
        <img src={heroImage} alt="DSA Hero" className="hero-image" />
        <div className="hero-text">
          <h1>Master Data Structures & Algorithms</h1>
          <p>Sharpen your problem-solving skills and prepare for coding interviews.</p>
          <Link to="/Latest-Blogs" className="explore-btn">Explore Latest Blogs</Link>
        </div>
      </div>

      {/* DSA Section */}
      <div className="dsa-section">
        <div className="dsa-content">
          <h2>Why Learn DSA?</h2>
          <p>Data Structures & Algorithms are the foundation of efficient coding and competitive programming.</p>
          <ul>
            <li>Improve problem-solving skills</li>
            <li>Crack coding interviews</li>
            <li>Optimize performance in real-world applications</li>
          </ul>
          <Link to="/DSA" className="learn-more-btn">Learn More</Link>
        </div>
        <img src={dsaImage} alt="DSA Illustration" className="dsa-image" />
      </div>
    </div>
  );
}

export default Home;
